import React, {useState} from 'react'

const MyComp = () => {
  const [fruits, setFruits] = useState(['apple', 'banana', 'mango']);

  return (
    <div>
        <h2>Lists of Fruits</h2>
        {fruits.map((fruit, index) => <li>{fruit}</li>)}
        <ol>{fruits}</ol>

    </div>
  )
}

export default MyComp
